import ColorBlock from './ColorBlock';
import ColorPanel from './ColorPanel';
import { PRESET_COLORS } from './constant';
import IconTrigger from './IconTrigger';
import { ColorGroup, ColorPickerProps } from './types';

// \u5C06PRESET_COLORS\u8F6C\u6362\u4E3AColorPreset\u9700\u8981\u7684\u683C\u5F0F
const defaultColorGroups: ColorGroup[] = [
  {
    // title: '\u9884\u8BBE\u989C\u8272',
    colors: PRESET_COLORS,
  },
];

const ColorPicker: FC<ColorPickerProps> = ({
  children,
  value,
  label,
  itemSize = 28,
  popoverProps = {},
  onChange,
  rowWrapCount = 11,
  presets = defaultColorGroups,
  readOnly = false,
  trigger = 'block',
  onOpenChange,
  colorToolTip,
}) => {
  const [open, setOpen] = useState(false);

  const onColorChange = useCallback(
    (color: string) => {
      if (readOnly) {
        return;
      }
      onChange?.(color);
      setOpen(false);
    },
    [onChange, readOnly],
  );

  const handleClickTrigger = useCallback(() => {
    if (readOnly) {
      return;
    }
    setOpen(true);
  }, [readOnly]);

  const renderTrigger = () => {
    if (trigger === 'icon') {
      return (
        <IconTrigger
          color={value}
          label={label}
          onClick={handleClickTrigger}
          open={!open}
          readOnly={readOnly}
        />
      );
    }
    if (isValidElement(children)) {
      const _children = cloneElement(children, {
        ...(children.props as any),
        onClick: handleClickTrigger,
        color: value,
      });
      return _children;
    }
    return (
      <ColorBlock
        color={value}
        size={itemSize}
        rowWrapCount={rowWrapCount}
        onClick={handleClickTrigger}
        readOnly={readOnly}
        tooltipProps={colorToolTip}
      />
    );
  };

  return (
    <Popover
      showArrow={false}
      trigger="click"
      placement="bottomLeft"
      {...popoverProps}
      open={readOnly ? false : open}
      onOpenChange={(_open) => {
        if (readOnly) {
          return;
        }
        setOpen(_open);
        onOpenChange?.(_open);
      }}
      content={
        <ColorPanel
          rowWrapCount={rowWrapCount}
          itemSize={itemSize}
          presets={presets}
          value={value}
          onChange={onColorChange}
          colorToolTip={colorToolTip}
        />
      }
    >
      {renderTrigger()}
    </Popover>
  );
};

export default ColorPicker;
export type { ColorPickerProps };
